            'FacilityName': 'OLALLIE ON MCKENZIE HIGHWAY',
            'FacilityDescription': '<h2>Overview</h2>\nNestled on the banks of the McKenzie River and Olallie Creek, Olallie Campground provides a superb setting for a getaway into nature. The lower loop offers mesmerizing views of both the river and the creek while the upper loop is set further in the trees with many sites facing the creek.\n  \nThe McKenzie River is a tributary of the Willamette River that runs for 90 miles, flowing into the southernmost end of the Willamette Valley.<h2>Recreation</h2>\nFishing, rafting and swimming are three top activities in the river.  A day use picnic area is also available at the campground. \n  \n Nearby is the 26 mile McKenzie River National Recreation Trail, which provides access to world class mountain biking and hiking. <h2>Facilities</h2>\nThis campground has 16 sites divided into two loops along the eastern banks of the river by Olallie Creek. No electric hookups are available at the campground. Picnic tables, vault toilets and drinking water are among the amenities available. A camp host is on-site, and firewood is available for purchase.<h2>Natural Features</h2>\nOlallie Campground is located in the midsection of the Cascades mountain range in western Oregon. All campgrounds are nicely shaded by Douglas fir, maple and alder. The Willamette National Forest stretches for 110 miles with varied landscapes of high mountains, narrow canyons, cascading streams, and wooded slopes.',
