            'FacilityName': 'Walt Haring Sno-Park/Campground',
            'FacilityDescription': '<p>Walt Haring Sno-Park is conveniently located 5 minutes northwest of Chemult, Oregon. Known for the Chemult Sled Dog Races the third weekend of every January, Walt Haring offers multiple snowmobile and nordic ski trails. The trailhead, elevation 4,800 feet, sits on the eastern edge of the Cascade Range, serving up cold, powdery snow and crisp, sunny days. It’s a lively ride on your snowmobile to pristine Miller Lake, just 12 miles from the Sno-Park. The snowmobile trail clearly connects to a larger network of trails. </p><p>The multiple cross country ski trails are groomed sporadically by volunteers each winter. Groomed or ungroomed, they offer a classic skiing experience. The generally easy trails cut through a pine plantation and mature ponderosas. Two hilltops, one beginner and one moderate, offer views of Mount Thielsen and surrounding peaks. The trails are usually covered with snow from mid-December through mid-March. </p><p><strong>Campground</strong>: Campers are welcome at Walt Haring year-round at any of the 10 campsites. The four vaulted toilets, at Walt Haring Sno-Park, receive year round maintenance. However, the trailer dump station and potable water are available only during the summer time. You can also use the picnic tables and fire grates for picnicking and relaxing. The spacious, log-style warming hut offers shelter, a wood stove, and benches on a first come, first served basis. Walt Haring is often used for hunting camps in the fall.</p><p>For more information on the Walt Haring Sno-Park, contact the Chemult Ranger District (541) 365-7001.</p>',
