            'FacilityName': 'UNION CREEK CAMPGROUND',
            'FacilityDescription': '<h2>Overview</h2>\n One of Eastern Oregon’s largest Forest Service campgrounds, Union Creek Campground is a recreationalists’ heaven. Sitting along Phillips Reservoir’s North shore, Union Creek Campground boasts many amenities including over 60 tent/trailer sites, some with full hookups. There is access to boating, mountain biking, hiking and more.  \n\nThis campground is part of the Union Creek Recreation Area, which includes a picnic and day-use area. Union Creek Campground is set on three loops with separate walk-in tent camping, and it has four group sites that can accommodate large groups up to  60 people<h2>Recreation</h2>\nThe campground is near a boat launch and a small, rocky swim beach. Activities include swimming, fishing, boating, and water skiing.  Anglers can fish for bass, trout and perch. \n\nThere\'s an access point for the Phillips Lake Shoreline Trail, a scenic trail for hiking and mountain biking. This trail can be connected to make a 16 mile loop around the lake.<h2>Facilities</h2>\nThe parking spurs are paved and gravel and large enough for any size RV. Several sites offer full hookups, and some others offer water and electric.  \n\nUnits are equipped with picnic tables and grills. Drinking water and flush toilets are available.\n\nSome of the facilities are handicap-accessible.<h2>Natural Features</h2>\nPhillips Reservoir is a popular destination within the Wallowa-Whitman National Forest because it offers scenic views of the surrounding Elkhorn Mountains. The \nshoreline is forested with a mix of Ponderosa pine and various firs interspersed with small grasslands.  \n\nVisitors enjoy several varieties of colorful wildflowers in the spring.\n<h2>Nearby Attractions</h2>\nThe historic gold mining town of Sumpter is about 10 miles away, West of Hwy 7. Visitors can explore the Sumpter Dredge State Heritage Park, browse the holiday weekend flea markets or take a ride on a historic steam locomotive.<h2>Charges &amp; Cancellations</h2>\n A $10.00 service fee will apply if you change or cancel your reservation. Late cancellations are subject to additional fees. For full details see NRRS Reservation Policy ',
