            'ParentRecAreaID': '261',
            'FacilityName': 'WEST PARK (OR)',
            'FacilityDescription': '<h2>Overview</h2>\nWest Park is located within McNary Dam Wildlife Area just downstream of McNary Dam in Eastern Oregon on the Mid-Columbia River.<h2>Recreation</h2>\nThe park provides two softball fields and a playset for the children to enjoy the park.  There is also close access to the McNary Dam Wildlife Areas and its trail system.<h2>Facilities</h2>\nWest Park offers two reservable picnic shelters.  West Park #1 Steelhead Shelter has eight picnic tables and two fire grills and West Park #2 Coho Shelter has 10 picnic tables and two fire grills.  Both shelters also offer electricity.<h2>Natural Features</h2>\nThe park is located within the McNary Dam Wildlife Area.  Day users enjoy the beautiful park with its mature shade trees.\n<h2>Nearby Attractions</h2>\nThe Pacific Salmon Visitor Center, Oregon Fish Viewing Room and the McNary Dam Wildlife Area with its beautiful natural trails are all in close proximity to West Park.',
