            'ParentRecAreaID': '1111',
            'FacilityName': 'Olive Lake Campground',
            'FacilityDescription': '<p>Nestled on the edge of a lake, high in the Blue Mountains of Eastern Oregon, this popular campground is only 8 miles west of the historic Fremont Powerhouse and 12 miles west of the old mining town of Granite.  The campground features 28 campsites and 7 accessible toilet facilities.  Other features include a 2-mile hiking trail around the lake with nearby access to wilderness and scenic area trails, a boat ramp and 2 docks. There is no potable water or garbage service, so please pack your garbage home.  </p><p>Besides beautiful scenery, the lake offers many opportunities for wildlife viewing--particularly a nesting pair of osprey that return annually.  Activities in this area include fishing, boating, swimming, hiking, hunting, and photography.  Within 20 miles are several historic sites.</p>',
            'FacilityTypeDescription': 'Campground',
            'FacilityUseFeeDescription': '',
            'FacilityDirections': '<p>From Ukiah, OR, travel south on County Road 1475 (turns into Forest Service Road 52 after 5 miles).  Go about 48.5 miles to the town of Granite.  Instead of entering the town, turn right onto County Road 24/Forest Service Road (FSR) 10 and travel about 3.5 miles to the end of the pavement.  At this point take the gravel road that heads up the hill to the right (FSR 10).  Travel about 9 miles on FSR 10 to FSR 1000480.  Take a left on FSR 1000480 and travel about ¼ into the campground.</p><p>From Dale, OR, travel 1 mile east on FSR 55 to the junction of FSR 10.  Take a right on FSR 10 (gravel) and travel 26 miles to FSR 1000480.  Take a right on FSR 1000480 and travel about ¼ into the campground.</p>',
