            'FacilityName': 'CRESCENT LAKE GUARD STATION',
            'FacilityDescription': '<h2>Overview</h2>\nThe Crescent Lake Guard Station, built in the early 1930s, is a one bedroom, one bath cabin on the eastern shore of Crescent Lake, managed by the Crescent Ranger District, Deschutes National Forest.<h2>Recreation</h2>\nA boat launch is nearby, and Crescent Lake Resort is within walking distance and offers a number of services including food, fishing supplies and boat rentals.<h2>Facilities</h2>\nThe Guard Station is approximately 670 square feet with a full kitchen, a furnished living room that includes a couch (folds out to full bed), an original buffet, a desk and a newly installed gas wood stove\'s heater. The kitchen includes a fridge, stove and sink.  The bedroom has a full bed, and the restroom has a claw foot tub, a toilet and a pedestal sink.  Outside amenities include a picnic table, a fire grill and a horseshoe pit.<h2>Natural Features</h2>\nCrescent Lake is in the Deschutes National Forest in a naturally glaciated basin behind a moraine dam and lays just east of the summit of the Cascade Mountain Range in northern Klamath County.  It is a popular recreation lake in a setting of wooded shorelines, sandy beaches and brilliant blue-green water.  The Guard Station sits atop a small hill overlooking Crescent Lake in an open ponderosa stand.\n<h2>Nearby Attractions</h2>\nThis area is a typical Oregon summer recreation area which features Crescent Lake, Odell Lake, Waldo Lake and Gold Lake.  The Diamond Peak Wilderness trail can be accessed nearby.\n\nAlso nearby: beach, boat launch, resort, lodging, restaurants, boat rentals.',
            'FacilityTypeDescription': 'Campground',
            'FacilityUseFeeDescription': '',
            'FacilityDirections': 'From Crescent, OR: Travel 12.2 miles west on County Road 61/Crescent Cut-off Road, then 3.5 miles north on Highway 58, then 2.2 miles west on Forest Road 60/OR-429 S.\n<br /><br />\nOnce you have reached the Sno-Park, stay straight and follow signs to the Resort on Forest Road 6005 (1,000ft). Still heading towards the Resort, turn right on Forest Road 6005-100 and then left on Forest Road 6005-105. The Guard Station will be on the right side of the road towards the lake. (See vicinity map located under the &quot;Facility Map&quot; tab).',
