            'FacilityName': 'Priest Hole Recreation Site',
            'FacilityDescription': 'For a rustic overnight stay deep in eastern Oregon, let your tires roll past the Painted Hills-one of <a href="http://traveloregon.com/7wonders/"> Oregon’s Seven Wonders</a>-and drive deep into John Day River Territory to the Priest Hole Recreation Site. Although primitive, camping here lands you in the middle of the Wild and Scenic John Day River, designated for scenery, recreation, fish, wildlife, and geologic values. Camping is allowed everywhere, including on the gravel bar northeast of Priest Hole, where you sleep to the gurgle of the river and stepping out of your tent or trailer lands your foot in the water.<h2>Know Before You Go:</h2><ul><li>Open YEAR ROUND but the rough road can make access difficult in winter.</li><li>ACCESSIBILITY is primitive and not easily accessible for people with disabilities. </li><li>NO FEES for camping or floating the one-mile section around Priest Hole. There is one toilet; NO potable water, trash cans or campsite amenities. </li><li>PETS ARE ALLOWED under owner control. Watch for rattlesnakes. </li><li><a href="http://www.dfw.state.or.us/resources/licenses_regs/licenses_fees.asp"> HUNTING/FISHING LICENSES ARE REQUIRED. </a></li><li>Fire restrictions run June 1 – September 30 (liquid gas or propane only).</li></ul><h2>Point of Interest:</h2>Priest Hole is a local favorite for fishing and swimming. Stopping here is a natural part of a visit to the Painted Hills, Sutton Mountain Back Country Byway and eastern Oregon!<br><br><a href=" https://www.blm.gov/sites/blm.gov/files/documents/files/Priest_Hole_brochure.pdf"> Priest Hole Brochure</a>\r\n<br><br><a href="https://www.youtube.com/watch?v=hs9BBgGtL1Y"> Explore Oregon Recreation:  Priest Hole\r\n</a>',
            'FacilityTypeDescription': 'Facility',
            'FacilityUseFeeDescription': 'No FEES for camping or floating the one-mile section around Priest Hole.',
            'FacilityDirections': 'Priest Hole is located on the John Day River about 12 miles from Mitchell, Oregon. From\r\nPrineville, head east on Highway 26 and turn north on Burnt Ranch Road toward the John\r\nDay Fossil Beds, Painted Hills Unit. Pass the Painted Hills and follow the gravel road for three\r\nmiles. Take a right (uphill) at the junction of Priest Hole or Burnt Ranch Rec Sites. From\r\nthere, take a left downhill, following the sign to Priest Hole.',
