            'FacilityName': 'Chickahominy Recreation Site',
            'FacilityDescription': '<h2>Overview:</h2>One of Eastern Oregon\'s most popular fishing spots, man-made Chickahominy Reservoir was first stocked with rainbow trout in the summer of 1967.  It is still stocked once or twice a year with fingerlings and legal-size fish.  The water level fluctuates with the amount of spring run-off and can be low at times, affecting the availability of fisheries.  The recreation site offers 28 campsites, a fish cleaning station, drinking water, vault restrooms and a boat ramp.  The extensive valley where Chickahominy Reservoir lies is surrounded by foothills, distant buttes and rough ridges - a landscape that provides far-reaching views of the open high desert country.<h2>Know Before You Go:</h2><ul><li>The fishing season peaks in June and resumes in September as the hot summer weather ends.  Ice fishing is popular from December to late February.</li><li>Shade is limited and strong winds are common; be prepared to tie everything down. </li><li>Five, eight-inch minimum length trout per day limit; bait is allowed.</li></ul><h2>Point of Interest:</h2>Wildlife species common to the area include mule deer, pronghorn antelope, black-tailed jackrabbits, coyotes, and ground squirrels.  A variety of waterfowl, raptors and songbirds frequent the area as well.<br><br><a href="https://www.blm.gov/sites/blm.gov/files/documents/files/BUR_chickahominy_brochure.pdf">chickahominy_brochure.pdf</a>',
