            'FacilityName': 'Horseglade Trailhead',
            'FacilityDescription': '<p><strong>Provides access to</strong>: <a href="http://www.fs.usda.gov/recarea/fremont-winema/recarea/?recid=59925">Woods Line Spur </a>of the <a href="http://oregonstateparks.org/index.cfm?do=parkPage.dsp_parkPage&parkId=167">OC and E Trail</a>. Trail users can go south following the Five Mile Creek or head north toward the Sycan Marsh to view Merritt Creek Trestle. </p><p>The Horseglade Trailhead, 40 minutes north of Bly, Oregon, is situated on the Oregon California and Eastern State (OC&E) Trail, a 100-mile trail built on the old railbed of the OC&E Railroad. This trail is open to hikers, horseback riders and mountain bikers. It begins in the heart of Klamath Falls, Oregon, extending east to Bly, Oregon, and north to the lush Sycan Marsh on the Woods Line Spur.</p><p>Amenities at the trailhead include a picnic table, campfire ring, vault toilet and a parking area with room for trailer turnaround. Dispersed camping is allowed.</p><p>There is no potable water. Visitors need to pack plenty of water. Maintenance services are provided from June 15th through September 15th</p>',
            'FacilityTypeDescription': 'Facility',
            'FacilityUseFeeDescription': '',
            'FacilityDirections': '<p>Horseglade Trailhead is located 40 minutes northwest of Bly, OR.</p><p>From Bly, OR take Oregon Highway 140 west toward Klamath Falls, Oregon and turn right onto Ivory Pine Road. Continue north on Ivory Pine Road. Turn left on Forest Service Road 27 to the trailhead.</p><p><img alt="Trailhead vicinity map" src="http://www.fs.usda.gov/Internet/FSE_MEDIA/fsbdev3_053975.gif" style="height:386px; width:380px"/></p>',
